import styled from "styled-components"

export const Title = styled.h1`
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    position: absolute;
`;
export const Container = styled.div`
    background: #FFFFFF;
`;
